description:
Rocco Siffredi and Nacho Vidal: could they be the best buddy team since Lethal Weapon? With Nacho vs. Rocco, Rocco dips into his vaults for seven mind-blowing, over-the-top scenes. Revisit the early days of the Dynamic Duo as they plunder their way through no less than seventeen of the sweetest smut sirens from around the world to ever open up and say &quot;glug&quot; on camera! From Ibiza to Budapest, the action is non-stop, featuring familiar favorites including Angel Dark, Roxy Jezel, Sandra Romain and Katja Love, as well as a bevy of equally luscious lovelies ready to be enjoyed for the first time all over again!

